import React, { useContext } from "react";
import AuthContext from "../../context/AuthContext";
import { Link, useNavigate } from "react-router-dom";

const HomePage = () => {
  const { user } = useContext(AuthContext);

  return (
    <ul>
      <li>
        {user && (
          <button
            onClick={() => {
              navigate("/spots");
            }}
          >
            Spots
          </button>
        )}
      </li>
      <li>
        {user && (
          <button
            onClick={() => {
              navigate("/friendsPage");
            }}
          >
            Friends
          </button>
        )}
      </li>
    </ul>
  );
};

export default HomePage;
